import './App.css';

function App() {
  return (
    <div className="App">
      <div className="datos">
        <label>Username: <input type="text"></input></label>
        <label>Password: <input type="password"></input></label>
        <button>Registrar</button>
      </div>
    </div>
  );
}

export default App;
